INSERT INTO `products` VALUES (1,7,'Bàn làm việc 120x60cm hệ OMA II gỗ plywood lắp ráp ngàm HBOM213',1590000,1430000,'Bàn làm việc 120x60cm hệ OMA II gỗ plywood lắp ráp ngàm HBOM213\n\n        THÔNG TIN CHI TIẾT SẢN PHẨM :\n        \n        Hướng dẫn sử dụng: bàn làm việc, bàn văn phòng...\n        Chất liệu: Gỗ Plywood phủ melamin dày 18mm. Sắt vuông 30mm, 30x60mm và giăng bàn 25x50mm; sắt dày 1.2mm cơ cấu lắp ráp\n        Màu sắc: Mặt bàn melamin vân tối ( hoặc vân sồi hoặc giả màu bê tông). Khung chân sắt sơn tĩnh điện đen hoặc trắng\n        Kích thước (D x R x C): 100x60x75(cm)\n        Bảo hành: 12 Tháng\n        Bàn làm việc 100x60cm gỗ Plywood phủ melamin chân hệ Slean\n        \n        Bàn làm việc 100x60cm gỗ Plywood phủ melamin vân sồi chân hệ Slean có quỳ\n        \n        Ưu điểm của sản phẩm : \n        \n        Chân bàn được làm bằng sắt vuông 30mm, 30x60mm và giăng bàn sắt 25x50mm, loại dày 1,2mm rất cứng cáp, chịu lực tốt, có tuổi thọ và độ bền cao.\n        Bề mặt sắt đã được chúng tôi phủ một lớp bột sơn tĩnh điện chống gỉ, chống trầy xước, chống ăn mòn hóa học.\n        Sử dụng trong nhiều năm mà không sợ hư hao.\n        Được gia công cẩn thận mang lại tính thẩm mỹ cao.\n        Cơ cấu lắp ráp thông minh, linh hoạt, dễ sử dụng.\n        Kiểu dáng đơn giản không bao giờ lỗi thời.\n        Chân sắt lắp ráp cho bàn 100x60cm hệ SLEAN\n        \n        Chân sắt lắp ráp cho bàn 100x60cm hệ SLEAN có quỳ\n        \n        Hướng dẫn lắp ráp bàn làm việc chân nội thất Kzone\n        \n        Với mong muốn mang đến dịch vụ tốt nhất cho khách hàng, bảng hướng dẫn lắp ráp bàn làm việc HomeOffice giúp bạn có thể dễ dàng hoàn thiện bàn làm việc khi mua bàn dưới hình thức phụ kiện rời. Bảng hướng dẫn gồm số lượng chi tiết các phụ kiện và các bước để lắp ráp các phụ kiện lại với nhau thành bàn hoàn thiện một cách nhanh chóng và tiện lợi nhất.\n        \n        - Bước 1 : Kiểm tra các phụ kiện ban đầu và sử dụng ốc lục giá liên kết ngàm của khung chân và thanh giằng\n        \n        - Bước 2 : Căn vị trí mặt bàn đều các mép và sử dụng vít bắt gỗ liên kết mặt bàn với khung chân\n        \n        - Bước 3 : Hoàn thiện lắp ráp\n        \n        Bảng hướng dẫn chi tiết cách lắp ráp bàn làm việc chân bàn cơ cấu ngàm từ HomeOffice\n        ',NULL,'https://homeoffice.com.vn/images/thumbnails/300/300/detailed/67/ban-lam-viec-he-chan-oma-ii-go-plywood-1.jpg','ban-lam-viec-120x60cm-he-oma-ii-go-plywood-lap-rap-ngam-hbom213',0,0,15,'2024-03-04 03:48:45',NULL,NULL),(2,7,'Bàn làm việc 120x60cm gỗ Plywood phủ melamin chân hệ Slean HBSL004',1540000,1386000,'Bàn làm việc 120x60cm gỗ Plywood phủ melamin chân hệ Slean HBSL004\n\n        THÔNG TIN CHI TIẾT SẢN PHẨM :\n        \n        Hướng dẫn sử dụng: bàn làm việc, bàn văn phòng...\n        Chất liệu: Gỗ Plywood phủ melamin dày 18mm. Sắt vuông 30mm, 30x60mm và giăng bàn 25x50mm; sắt dày 1.2mm cơ cấu lắp ráp\n        Màu sắc: Mặt bàn melamin vân tối ( hoặc vân sồi hoặc giả màu bê tông). Khung chân sắt sơn tĩnh điện đen hoặc trắng\n        Kích thước (D x R x C): 100x60x75(cm)\n        Bảo hành: 12 Tháng\n        Bàn làm việc 100x60cm gỗ Plywood phủ melamin chân hệ Slean\n        \n        Bàn làm việc 100x60cm gỗ Plywood phủ melamin vân sồi chân hệ Slean có quỳ\n        \n        Ưu điểm của sản phẩm : \n        \n        Chân bàn được làm bằng sắt vuông 30mm, 30x60mm và giăng bàn sắt 25x50mm, loại dày 1,2mm rất cứng cáp, chịu lực tốt, có tuổi thọ và độ bền cao.\n        Bề mặt sắt đã được chúng tôi phủ một lớp bột sơn tĩnh điện chống gỉ, chống trầy xước, chống ăn mòn hóa học.\n        Sử dụng trong nhiều năm mà không sợ hư hao.\n        Được gia công cẩn thận mang lại tính thẩm mỹ cao.\n        Cơ cấu lắp ráp thông minh, linh hoạt, dễ sử dụng.\n        Kiểu dáng đơn giản không bao giờ lỗi thời.\n        Chân sắt lắp ráp cho bàn 100x60cm hệ SLEAN\n        \n        Chân sắt lắp ráp cho bàn 100x60cm hệ SLEAN có quỳ\n        \n        Hướng dẫn lắp ráp bàn làm việc chân nội thất K